angular.module("sortinApp").service("TopicService",function(n){this.getPairs=function(){return n.get("/pairs").then(function(n){return n},function(n){alert("Error finding pairs.")})},this.createPair=function(r){return n.post("/pairs",r).then(function(n){return n},function(n){alert("Error creating pair.")})},this.addLike=function(r){var t="/pairs/"+r._id;return n.put(t,r).then(function(n){return n},function(n){console.log("Error adding like.")})},this.getFonts=function(){return n.get("/fonts").then(function(n){return n},function(n){alert("Error finding fonts.")})}});